/**
 * Convert the stateObject into a base64 image based on baseImage
 *
 * @param baseImage
 * @param stateObject
 */
function shareState (baseImage: String, stateObject: Object) {
    // console.log('baseImage', baseImage);
    console.log('stateObject', stateObject);

    const stateImage = baseImage;
    console.log('stateImage', stateImage);

    return stateImage;
}


const baseImage = 'data:image/png;base64,';
const stateObject = {
    app: {
        theme: 'dark'
    },
    user: {
        logged: false
    }
}

shareState(baseImage, stateObject);
